export const calcCourseNumColor = (courseNum: number): string => {
    if (courseNum < 200) {
      return "#3bb87c";
    } else if (courseNum < 300) {
      return "#3bb87c"
    } else if (courseNum < 400) {
      return "#296330"
    } else if (courseNum < 500) {
      return "#1e3b22"
    }

    return "#414f41";
}
